  | [] -> ""
  | a :: t ->
      let v1 = f a in
      if t != [] then v1 ^ "\n\n;(*L3*)" ^ process_generic_list_tail name t f
      else v1

and process_generic_list name a f : string =
  "(" ^ name ^ "["
  ^ (match a with
    | [] -> ""
    | a :: t ->
        let v1 = f a in
        if t != [] then v1 ^ "\n\n;(*L4*)" ^ process_generic_list_tail name t f
        else v1)
  ^ "] )"

